import React, {Component} from 'react';

class ListQuizzes extends Component {
    constructor(props) {
        super(props);
        this.state = {
            quizzes: []
        };
    };

    componentDidMount() {
        fetch('http://localhost:8000/quiz/')
            .then(async res => await res.json())
            .then((data) => {
                this.setState({ quizzes: data})
            })
            .catch(console.log)
    }

    render() {

